import React, { useState } from 'react';
import './navbar.css';

function NavBar() {
  const [activeTab, setActiveTab] = useState('home');

  const handleTabClick = (tab) => {
    setActiveTab(tab);
  };

  return (
    <nav className="navbar">
      <ul className="nav">
        <li className={`nav-item ${activeTab === 'home' ? 'active' : ''}`}>
          <a className="nav-link" href="/" onClick={() => handleTabClick('home')}>
            Home
          </a>
        </li>
        <li className={`nav-item ${activeTab === 'add-to' ? 'active' : ''}`}>
          <a className="nav-link" href="/add-todo" onClick={() => handleTabClick('add-todo')}>
            Add To
          </a>
        </li>
        <li className={`nav-item ${activeTab === 'profile' ? 'active' : ''}`}>
          <a className="nav-link" href="/profile" onClick={() => handleTabClick('profile')}>
            Profile
          </a>
        </li>
      </ul>
    </nav>
  );
}

export default NavBar;
